import * as a from './StyledLogin.js';

function Login() {
  return (
    <a.LoginBox>
      <a.Logo src={require('../../images/LogoBlack.png')}/>
      <a.InputWrap>
        <a.InputBox placeholder='이메일'></a.InputBox>
        <a.InputBox placeholder='비밀번호'></a.InputBox>
        <a.EyeIcon src={require('')}/>
      </a.InputWrap>
    </a.LoginBox>
  );
}

export default Login;
